# finding the length of the longestPlaindrome in the given string

import datetime 
def longestPlaindrome(string: str) -> str:
    str_time = datetime.datetime.now()
    m = ""

    for i in range(len(string)):
        for j in range(len(string), i, -1):
            if len(m) >= j-i:
                break
            elif string[i:j] == string[i:j][::-1]:
                m = string[i:j]
                break
    end_time = datetime.datetime.now()
    total_time = end_time - str_time
    print(total_time)
    return m
str = ""
print(longestPlaindrome(str))
print(len(str))